import React from 'react';
import * as TabsPrimitive from '@radix-ui/react-tabs';

export function Tabs({ className, ...props }) {
  return <TabsPrimitive.Root className={className} {...props} />;
}

export function TabsList({ className, ...props }) {
  return <TabsPrimitive.List className={`flex ${className}`} {...props} />;
}

export function TabsTrigger({ className, ...props }) {
  return (
    <TabsPrimitive.Trigger
      className={`px-4 py-2 hover:bg-gray-100 ${className}`}
      {...props}
    />
  );
}

export function TabsContent({ className, ...props }) {
  return <TabsPrimitive.Content className={className} {...props} />;
}
